import Card from 'reactstrap';

export default class CurrentDraft extends Component {
    constructor(props) {
        super(props);
        this.state = {
            currentPlayerNo: 0,
            currentPlayerName:""

        };
    }
    // render() {
    //     return(
    //         <div>
    //           {this.getPlayers(this.props.playerList).join()}
    //             {this.getCurrentPlayer().join()}
    //         </div>
    //     )
    // }

    getPlayers(currentList){
        var tempList = [];
        console.log(currentList);
        for(const player of []){
            tempList.push(
                <Card>
                    <Card.Body>
                        <Card.Title>Player {player.playerNum}</Card.Title>
                        <Card.Subtitle>{player.playerDrafted}</Card.Subtitle>
                    </Card.Body>
                </Card>
            )
        }
        return tempList;
    }
    render() {
        return this.props.playerList.map((player) => {
            return (
                <Card>
                    <Card.Body>
                        <Card.Title>Player {player.playerNum}</Card.Title>
                        <Card.Subtitle>{player.playerDrafted}</Card.Subtitle>
                    </Card.Body>
                </Card>
            );
        });
    }

    getCurrentPlayer(){
        var tempList2 = [];
        tempList2.push(
            <Card>
                <Card.Body>
                    <Card.Title>Player {this.state.currentPlayerNo}</Card.Title>
                    <Card.Subtitle>Drafting...</Card.Subtitle>
                </Card.Body>
            </Card>
        )
        return tempList2;
    }
}
